mapper.select:

select 

from jvd_kyosoba_jogai_joho
where KETTO_TOROKU_BANGO = #{kettoTorokuBango,jdbcType=CHAR}
  and RACE_CODE = #{raceCode,jdbcType=CHAR}
  and SHUTSUBA_TOHYO_UKETSUKE = #{shutsubaTohyoUketsuke,jdbcType=DECIMAL}

mapper.delete:

delete from jvd_kyosoba_jogai_joho
where KETTO_TOROKU_BANGO = #{kettoTorokuBango,jdbcType=CHAR}
  and RACE_CODE = #{raceCode,jdbcType=CHAR}
  and SHUTSUBA_TOHYO_UKETSUKE = #{shutsubaTohyoUketsuke,jdbcType=DECIMAL}
